INSERT INTO `serviceitems` (`id`, `user_id`, `service_profile_id`, `category_id`, `workstation_id`, `subscriber_id`, `title`, `image`, `excerpt`, `description`, `price`, `negotiations`, `addedby_id`, `editedby_id`, `status`, `active`, `created_at`, `updated_at`) VALUES
(1, 2, 33, 1, 1, 99, 'Plumber Service', '1_img_2021_12_21_114032_61205400.jpg', 'Plumbing is any system that conveys fluids for a wide range of applications. Plumbing uses pipes, valves, plumbing fixtures, tanks, and other apparatuses to convey fluids.', '<p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"Orlando-Emergency-Plumbing-Squad.jpg\"></p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;\"><b>Plumbing</b>&nbsp;is any system that conveys&nbsp;<a href=\"https://en.wikipedia.org/wiki/Fluid\" title=\"\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">fluids</a>&nbsp;for a wide range of applications. Plumbing uses&nbsp;<a href=\"https://en.wikipedia.org/wiki/Piping\" title=\"Piping\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">pipes</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Valve\" title=\"Valve\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">valves</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Piping_and_plumbing_fitting\" title=\"Piping and plumbing fitting\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">plumbing fixtures</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Storage_tank\" title=\"Storage tank\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">tanks</a>, and other apparatuses to convey fluids.<sup id=\"cite_ref-1\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Plumbing#cite_note-1\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[1]</a></sup>&nbsp;<a href=\"https://en.wikipedia.org/wiki/HVAC\" class=\"mw-redirect\" title=\"HVAC\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Heating and cooling</a>&nbsp;(HVAC),&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sewerage\" title=\"Sewerage\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">waste removal</a>, and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Drinking_water\" title=\"Drinking water\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">potable water</a>&nbsp;delivery are among the most common uses for plumbing, but it is not limited to these applications.<sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Plumbing#cite_note-2\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[2]</a></sup>&nbsp;The word derives from the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Latin\" title=\"Latin\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Latin</a>&nbsp;for&nbsp;<a href=\"https://en.wikipedia.org/wiki/Lead\" title=\"Lead\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">lead</a>,&nbsp;<i>plumbum</i>, as the first effective pipes used in the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sanitation_in_ancient_Rome\" title=\"Sanitation in ancient Rome\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Roman era</a>&nbsp;were&nbsp;<a href=\"https://en.wikipedia.org/wiki/Lead_pipe\" class=\"mw-redirect\" title=\"Lead pipe\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">lead pipes</a>.<sup id=\"cite_ref-3\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Plumbing#cite_note-3\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[3]</a></sup></p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;\">In the developed world, plumbing infrastructure is critical to&nbsp;<a href=\"https://en.wikipedia.org/wiki/Public_health\" title=\"Public health\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">public health</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Sanitation\" title=\"Sanitation\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">sanitation</a>.<sup id=\"cite_ref-4\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Plumbing#cite_note-4\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[4]</a></sup><sup id=\"cite_ref-5\" class=\"reference\" style=\"line-height: 1; unicode-bidi: isolate; white-space: nowrap; font-size: 11.2px;\"><a href=\"https://en.wikipedia.org/wiki/Plumbing#cite_note-5\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">[5]</a></sup></p><p style=\"margin: 0.5em 0px; color: rgb(32, 33, 34); font-family: sans-serif; font-size: 14px;\"><a href=\"https://en.wikipedia.org/wiki/Boilermaker\" title=\"Boilermaker\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Boilermakers</a>&nbsp;and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Pipefitter\" title=\"Pipefitter\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">pipefitters</a>&nbsp;are not&nbsp;<a href=\"https://en.wikipedia.org/wiki/Plumber\" title=\"Plumber\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">plumbers</a>&nbsp;although they work with&nbsp;<a href=\"https://en.wikipedia.org/wiki/Piping\" title=\"Piping\" style=\"color: rgb(6, 69, 173); background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">piping</a>&nbsp;as part of their trade and their work can include some plumbing.</p>', '1400.00', 1, 2, NULL, 'approved', 1, '2021-12-19 05:25:43', '2021-12-21 05:40:32');
